import React from 'react'
import data from './data.js'
import Joke from './joke'

function Content(){
    const DataComponents=data.map(joke= <joke key={data.key} quetion={data.quetion} answer={data.answer} />)
    const date= new Date
    const hours = date.getHours()

    const Style={
        fontSize: 40
    }

    let timeofday
    if (hours <12){
        timeofday='Morning'
        Style.color='blue'
    }
    else if (hours<17){
        timeofday='Afternoon'
        Style.color='red'
    }
    else{
        timeofday="Night"
        Style.color='green'
    }
    return(
        <div>
    <div>
        <h1 style={Style}>Good {timeofday}</h1>
    </div>
    <div>
        {DataComponents}
    </div>
    </div>
    )
}

export default Content
